 }
})


const Takecourse = () => {
 const toggle = () => {
  setIsOpen(!isOpen);
 };


 useEffect(() => {
  setVideoFilePath('assets/img/video.mp4')
  if (localStorage.Token) {

  } else {
   Toast.fire({
    icon: 'info',
    title: 'Please Login'
    })
   history.push('/login')
 }

 }, []);
